%[text] %[text:anchor:T_4D637CA1] # Enhancement of RGB Images
%[text] The methods that we learned to enhance grayscale images also apply to RGB images. In some cases, we can simply input the RGB image and manipulate the image as a whole, in other cases we need to manipulate the channels independently.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:H_F9F8E63C] ## 
%%
%[text] %[text:anchor:T_D3AB61B9] # Example One
%[text] Fix that damn Dress!
%[text] Can we adjust the image so that it looks right?
clearvars
close all
mmSetUnitDataFolder(2);
rgb = imread('black-blue-dress-super-169.jpg');
imshow(rgb)
%%
%[text] %[text:anchor:H_05FD7CD3] ## Install ImageAdjuster
%[text] To enhance an image, we can use the **imadjust** function to modify the histogram distribution. But for an RGB image, the syntax is not intuitive, especially if you want to fine tune the adjustments for each channel. 
%[text] The **ImageAdjuster** tool greatly simplifies using imadjust for RGB image. But it is not included with MATLAB. So we need to install it. 
%[text] %[text:anchor:H_8AA42A09] ### Add-on Tool
%[text] Run this code block to copy the word ImageAdjust to the clipboard
clipboard('copy','ImageAdjuster')
%[text] 1. Then, bring up the Home Tab
%[text] 2. Click the Add-ons Button ![](text:image:0c5e)
%[text] 3. Select the 'search for add-ons' box and paste. ImageAdjuster should be pasted here. If not, just type it out
%[text] 4. Search for '**ImageAdjuster'**
%[text] 5. Click on the ImageAdjuster page (by Brett Shoelson)
%[text] 6. Click on the Add button to install \
%[text] ![](text:image:0ef3)
%[text] - select Add to MATLAB
%[text] - Select "Open Folder"
%[text] - Double-Click on the ImageAdjuster.mlappinstall file
%[text] - Select Install
%[text] - ![](text:image:7fc6)
%[text] - Go back to the MATLAB drive (click on  MATLAB drive icon). \
%%
%[text] %[text:anchor:H_4138B441] ### Launching ImageAdjuster
%[text] **Action**
%[text] 1. Apps tab
%[text] 2. Select "ImageAdjuster"
%[text] 3. Click on yellow folder icon
%[text] 4. Import from Workspace
%[text] 5. Select *rgb*
%[text] 6. click on "Process Planes Individually"
%[text] 7. click on "Auto-Adjust"
%[text] 8. Monkey with the Gamma Settings
%[text] 9. Click on Done / Export \
%%
%[text] %[text:anchor:H_7BAD907C] ## Adjust Channels independently
%[text] After you have adjusted the image in the **ImageAdjuster** app, click on the Done/ export button. You should then find some code in the command window.
%[text] - Copy the code from command window
%[text] - Change ***imgin*** to ***rgb***. Change ***imgout*** to ***rgba***
%[text] - Execute \

%%
%[text] My Previous attempt
figure
rgba = imadjust(rgb,[0.24 0.20 0.12; 1.00 1.00 1.00], ...initial intensity ranges
    [0.00 0.00 0.00; 1.00 1.00 1.00], ... new intensity ranges
    [3.56 2.94 0.88]); % gamma settings for each channel
imshowpair(rgb,rgba,'montage')
%%
%[text] %[text:anchor:H_21991BCE] ## You've seen the 'dress', now try the sneaker
%[text] Some people claim that this sneaker is pink and white. I see gray and teal. Lets see if we can adjust the colors using 
close all
clearvars

mmSetUnitDataFolder(2)
img = imread('pink-and-white sneakers.jpg');

figure
imshow(img)
%[text] %[text:anchor:H_9E9B8A6D] ### 
%%
%[text] You can execute the app by its name
ImageAdjuster(img)
%[text] - hint: process the planes individually \
%%
%[text] Output from ImageAdjuster
imga = imadjust(img,[0.00 0.01 0.00; 0.62 0.83 0.80], ...
    [0.00 0.00 0.00; 1.00 1.00 1.00], ...
    [1.00 1.00 1.00]);
%%
imshow(imga)
%%
%[text] %[text:anchor:H_316E3191] ### Auto-enhance
%[text] We can auto-adjust the channels quite easily, without bringing up the ImageAdjuster app.
%[text] The function **stretchlim** calculates the values for us. And then we just plug them into **imadjust**, as follows
lh = stretchlim(img)
imga = imadjust(img,lh,[]);
imshow(imga)
%[text] - notice that the bottom row of numbers from **stretchlim** matches the second set of numbers sent out by **ImageAdjuster**
%[text] - Also notice that we input a second, empty input into ***imga*** \
%%
%[text] %[text:anchor:T_82C0637E] # Example Two
%[text] For this example, we will work on a histological section of the loop of henle
%[text] %[text:anchor:H_326A430F] ## Loop of Henle
%[text] ![](text:image:3924)![](text:image:0fcd) ![](text:image:3292)
clearvars
close all
mmSetUnitDataFolder(2)
image_name = 'loop_of_henle_cross_section.jpg';
rgb = imread(image_name);
%%
%[text] %[text:anchor:H_734A2AEC] ## Display Image 
figure

imshow(rgb)
title('Loop of Henle');
%%
%[text] %[text:anchor:H_90D74A49] ## Display Channel Histograms
%[text] The function **mmShowHist** automatically splits the channels and display the corresponding channels.
%[text] **Try it now**. Input rgb into **mmShowHist**
figure
mmShowHist(rgb)

%%
%[text] %[text:anchor:H_E874C66C] ### Organizing variables in a structure
%[text] Sometimes, if you are going to create a series of variables, you may want to organize them in a structure, to better describe the images and to keep your variables organized. Remember, creating a structure is very easy. You just use dot notation:
s.original = rgb;
%[text] - and now you have your image stored in a structure with a field name that's easy to understand \
%%
%[text] %[text:anchor:H_00266D3E] ## Auto-Enhance Contrast
%[text] We can auto adjust the image and then add the adjusted image to our structure
%[text] - Again, we use **stretchlim** to get the lowhigh inputs for **imadjust**
%[text] - Enhance contrast in ***rgb*** using **imadjust**
%[text] - Display rgb and rgba, side-by-side, using **imshowpair** \
lh = stretchlim(rgb);
s.adjust = imadjust(rgb,lh,[]); % here we add the adjusted image straight into a new field called adjust
%%
%[text] %[text:anchor:H_6ACCAB32] #### **You try.** 
%[text] - Display the images from the structure, ***s***,  side by side, in a montage.
%[text] - Display the original image on the left, and the adjusted image on the right \

%[text] - contrast enhanced, but color has been modified \
%%
%[text] %[text:anchor:H_8C887D3A] ## Complement
%[text] What does the complement of an rgb image look like?
%[text] - Create a complement of ***rgb*** and add the image directly to your structure ***s*** to a field called 'complement'
%[text] - Display the original image and the complement side-by-side as a montage \

%[text] - Cool. Although maybe not very useful.
%[text] - Why did the colors change so dramatically? \
%%
%[text] %[text:anchor:H_B3FCCF0C] ### Complement Histogram Comparison
%[text] Now that we have everything organized in a structure, we can use some programming tricks to display our images
%[text] For example, the following loop creates two figures, one to display the channels and histogram from the original image and the next from the complement image. 
%[text] Can you see how this FOR LOOP works?
for n=["original" "complement"]
    figure
    mmShowHist(s.(n)) % what does this syntax mean?
    sgtitle(n)
end
%[text] 
%%
%[text] %[text:anchor:H_8B7CD4C2] ## Image Sharpen
%[text] Recall that **imsharpen** uses an unsharp mask (Neighborhood processing).
%[text] - Sharpen the adjusted image from your s.adjust field using **imsharpen.**
%[text] - Add the sharpened image to a field in ***s*** called 'sharpen'
%[text] - Display the original image and the sharpened image side by side
%[text] - title as 'Sharpened Image' \

%%
%[text] %[text:anchor:H_48A997D2] ### More Sharpening
%[text] **imsharpen** accepts additional inputs. 
%[text] add a new field to your structure called 'sharpenMore' where you use the following inputs into **imsharpen** to sharpen the adjust image
%[text] - Radius (try a radius of 5)
%[text] - Amount (try an amount of 1)
%[text] - Display your sharpened result \
s.sharpenMore = imsharpen(s.original,Radius=5,...
    Amount=1)
%[text] - adjust radius and amount to taste \
%%
%[text] %[text:anchor:H_2469002B] ## Fast Local Laplacian Filtering
%[text] Another type of sharpening is called Laplacian Sharpening. Let's add that to our structure
edge_amplitude = .2; % adjust these values
smooth_factor = .5; % adjust these values

clf
s.laplacian = locallapfilt(rgb, edge_amplitude,smooth_factor);
imshow(s.laplacian)
title(sprintf('Laplacian Filtering, Edge %1.2f, Smooth %1.2f', edge_amplitude, smooth_factor));
%[text] - try modified the input settings \
%%
%[text] ### Display images in a structure
%[text] I have created a function `mmShowStruct` that displays any images stored in a structure in a tiled figure
figure
mmShowStruct(s)
%%
%[text] %[text:anchor:H_DA90D323] ## Decorreleation stretch
%[text] Decorrelation is fun. It's a way to enhance color differences in an image. Let's add that too. 
clf
s.decorr = decorrstretch(rgb,'tol',0.01); % adjust here
imshow(s.decorr)
title('s.decorr')
%%
%[text] %[text:anchor:H_BCCBE510] ## Final result
figure
tiledlayout('flow','TileSpacing','tight','Padding','tight')
mmShowStruct(s)
%%
%[text] Since we have organized everything nicely in a structure, we can use some programmatic tricks to display *everything*
fn = fieldnames(s); % get the fieldnames of the structure
fn = string(fn)'; % convert fieldnames to string array and transpose

figure
tiledlayout("flow","TileSpacing","none",Padding="tight")
for n=fn % runs for each element in fn
    nexttile
    imshow(s.(n))
    text(30,30, n,Color='white',fontweight='bold')
end
%[text] - how would you reorganize the display?
%[text] - how would you make original plot first? \
%%
%[text] This is basically what the mmShowStruct function does
mmShowStruct(s)

